import React from 'react';
import { Accordion, Card, Image } from 'react-bootstrap';
import './ConferenceTeam.css'; // Import your CSS file for custom styling

const ConferenceTeam = () => {
    const teamData = [
        // Replace these placeholders with your actual data for each team member
        {
            name: 'John Doe',
            profession: 'Web Developer',
            contact: 'john@example.com',
            imageSrc: '../../assests/male1.jpg',
        },
        // Add other team members' data here...
    ];

    return (
        <Accordion defaultActiveKey="0" className="conference-team">
            {teamData.map((member, index) => (
                <Card key={index}>
                    <Accordion.Toggle as={Card.Header} eventKey={index.toString()} className="toggle-header">
                        {member.name}
                    </Accordion.Toggle>
                    <Accordion.Collapse eventKey={index.toString()}>
                        <Card.Body className="team-details">
                            <div className="image-container">
                                <Image src={member.imageSrc} rounded />
                            </div>
                            <div className="person-details">
                                <p>{member.profession}</p>
                                <p>{member.contact}</p>
                            </div>
                        </Card.Body>
                    </Accordion.Collapse>
                </Card>
            ))}
        </Accordion>
    );
};

export default ConferenceTeam;
